import React from 'react';
import { Link as RouterLink } from 'react-router-dom';
import { Typography, Button } from '@mui/material';

function Navbar() {
  return (
    <div className="w-64 bg-gradient-to-b from-[#123458] to-[#123458] text-white h-screen fixed top-0 left-0 shadow-xl flex flex-col p-6">
      <Typography variant="h5" className="font-bold text-white mb-8">
        POS System
      </Typography>
      <nav className="flex flex-col space-y-4">
        <Button
          component={RouterLink}
          to="/"
          className="text-left text-white hover:bg-[#0f2d4a] rounded-lg px-4 py-2 transition-colors"
        >
          Products
        </Button>
        <Button
          component={RouterLink}
          to="/orders"
          className="text-left text-white hover:bg-[#0f2d4a] rounded-lg px-4 py-2 transition-colors"
        >
          Orders
        </Button>
        <Button
          component={RouterLink}
          to="/new-order"
          className="text-left text-white hover:bg-[#0f2d4a] rounded-lg px-4 py-2 transition-colors"
        >
          New Order
        </Button>
      </nav>
    </div>
  );
}

export default Navbar;
